% tl;dr: It's fast - datapipes is a lazy-evaluated modular pipeline library, where pipelines (= "datapipes") pretend to be
% a tensor/array while taking care of data loading, batching, memory
% management, multi-threading, and so on automatically under the hood.

datapipes = MatDatapipes.importDatapipesPython(); %[output:3146c383]
ops = datapipes.Ops;
contrast = datapipes.contrast;
path = "D:\temp_data_safe_to_delete\brain.rls\brain.j2k.h5";
arr = MatDatapipes.loadMatDatapipeCachePrefetched(path);
window_size = int32(25);
temporalContrast = arr.then(ops.bytes_to_float01_gpu).then(contrast.temporal_contrast(window_size));

datapipes.utils.benchmarking.print_memory_stats(temporalContrast.getPyHandle()); %[output:44219e94]
% Dataset is actually ready to use already, but we'll block until it is
% fully loaded  and ready for the benchmark
ds = py.getattr(arr.getPyHandle(), "_dataset");     % ignore
ds.block_until_fully_cached();                      % ignore

%%
m = datapipes.utils.benchmarking.mean_output_benchmark(temporalContrast.getPyHandle()); %[output:7957abb7]
quickPlot(MatDatapipes.tensorToMatArray(m)) %[output:6a257bbd]
%%


